import React from 'react';


function DisplayComponents2(props) {
  return (
    <div>

     <span>{(props.time.h >= 10)? props.time.ms : "0"+ props.time.ms}</span>&nbsp;:&nbsp;
    </div>

  );
}

export default DisplayComponents2;
